import React, {Component} from 'react';
import './../../assets/css/index.css';

class Header extends Component {
    render(){
        return(
            <div class="segoe">
                <div class="topcontainer">
                    <div class="topbar">
                        <i class="fa fa-twitter logocenter" aria-hidden="true"></i>
                    </div>			
                </div>
            </div>
        );
    }
}

module.exports = Header;
